import React from "react";
import {forwardRef} from "react";
import './about.css';

export default function About(ref) {
    return (
        <div>
            <div className='about-header-div'
                ref={ref}>
                <h1 className='about-intro-header'>About Me</h1>
            </div>
        </div>
    )
}
